const Postlist = ({ Posts }) => {
  return (
    <div>
      {
        Posts.map((user, i) => {
          return (
            <Personal_blog
              key={i}
              id={Personal_blog[i].id}
              name={Personal_blog[i].name}
              email={Personal_blog[i].email}
              />
          );
        })
      }
    </div>
  );
}

export default Postlist;
